  false,\n\t\"url\": null,\n\t\"notes\": \"The Stream Habitat - San Francisco Bay,
  Central and South Coasts [ds159] shapefile contains four years of in-stream salmonid
  habitat data at the reach level. The data have been summarized from habitat unit
  level data collected by DFG from July 1993 into September of 1997. The database
  represents salmonid stream habitat surveys from 57 streams. Approximately 216 miles
  of streams were surveyed. The database helps identify and describe in-stream habitat
  available to anadromous salmonids within watersheds of the California San Francisco
  Bay, Central and South Coast Hydrologic Regions. Data were collected using standardized
  survey techniques according to the version of the \"California Stream Habitat Restoration
  Manual\" (see Flosi et al.) that was current in the year of survey. Field survey
  teams measured up to 60 parameters for selected habitat units. Stream surveys typically
  started at the downstream confluence and proceeded upstream to the \"limit of anadromy\"
  as assessed by the survey crew. WHAT EACH RECORD REPRESENTS Each of the 100 records
  in this dataset represents in-stream habitat unit level data summarized at the stream
  reach level. A habitat unit is the base level for the stream habitat surveys and
  is generally determined by the occurrence of riffle, run and pool sections along
  the stream. Stream reaches are determined by changes in stream channel type as described
  by Rosgen (1994).\",\n\t\"license_title\": null,\n\t\"extras\": [{\n\t\t\"key\":
